import React from "react";
import HomeNavBar from "../components/HomeNavBar";

function Register() {
  return (
    <div className="flex h-screen">
      {/* Left Side*/}
      <div className="flex-1">
        <div className="flex flex-row justify-center">
          <img
            src="/images/Venom.jpg"
            alt="VenomPoster"
            className="left-0 top-4 z-10 w-[230px] h-[346px] object-cover rounded-3xl border-2 border-prim-grey-p"
          />
          <img
            src="/images/TheShawShankRedemption.jpg"
            alt="ShawShankRedemptionPoster"
            className="left-[calc(50%-125px)] top-0 z-20 w-[250px] h-[379px] object-cover rounded-3xl border-2 border-prim-grey-p"
          />
          <img
            src="/images/TheGodFather.jpg"
            alt="GodFatherPoster"
            className="right-0 top-4 z-10 w-[230px] h-[346px] object-cover rounded-3xl border-2 border-prim-grey-p"
          />
        </div>
      </div>
      {/* Right Side */}
      <div className="flex-1 bg-prim-offwhite">
        <p>RIGHT</p>
      </div>
    </div>
  );
}

export default Register;
